import React from "react";

function Card(card, onClickCard) {
  return (
    <div className="element" key={card.card._id}>
      <button className="element__delete" type="button" />
      <img alt={card.card.name} className="element__image" src={card.card.link} />
      <div className="element__block">
        <h2 className="element__text">{card.card.name}</h2>
        <div className="element__heart-area">
          <button className="element__heart" type="button" />
          <p className="element__heart-counter" />
        </div>
      </div>
    </div>
  );
}
export default Card;
